addEventListener("DOMContentLoaded",(()=>{const e=document.getElementsByClassName("jetpack-deprecate-dismissible");for(let t=0;t<e.length;++t)e[t].hasAttribute("id")&&e[t].addEventListener("click",(i=>{i.target.classList.contains("notice-dismiss")&&(document.cookie="jetpack_deprecate_dismissed["+e[t].getAttribute("id")+"]=1; expires=Fri, 31 Dec 9999 23:59:59 GMT; SameSite=None;")}))}));